import ApiValidator from "../components/api-validator/ApiValidator";
import Home from "../pages/home/Home";

export const GuiRoutes = [
  {
    path: "",
    component: Home,
    title: "Home",
  },
  {
    path: "/api-doc-gen/*",
    component: ApiValidator,
    title: "Home",
  },
];
